import React from "react";
import { GoogleMap, LoadScript, Marker } from "@react-google-maps/api";

const containerStyle = {
  width: "100%",
  height: "100vh",
};

const center = {
  lat: 14.1467, // Majayjay, Laguna (approx)
  lng: 121.4708,
};

function App() {
  return (
    <LoadScript googleMapsApiKey="AIzaSyA6D72kCqt2yln8Yhfg0Y0iE25F0ndZtO4">
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={center}
        zoom={13}
      >
        <Marker position={center} />
      </GoogleMap>
    </LoadScript>
  );
}

export default App;
